const WithFancyText = (wrappedComponent) => {
    return (props)=>{
        const fancyStyle={fontStyle:"italic", fontWeight:"bold"};
        return(
            <div style={fancyStyle}>
                <wrappedComponent {...props}/>
            </div>
        )
    };
}
 
export default WithFancyText;
